Steven Russell is een getrouwde vader en oplichter die in de Texaanse 
gevangenis belandt. Daar wordt hij smoorverliefd op zijn celgenoot Phillip 
Morris. Morris wordt echter al snel vrijgelaten, waarop Russell besluit uit 
de gevangenis te ontsnappen om hem achterna te gaan.

